patient_age.query:
q = load "${App.Datasets.HLS_Patient8_tp.FullyQualifiedName}";
result = group q by all;
result = foreach result generate round(avg(q.'{{cell(Static_1_1.selection, 0, "Text2").asObject()}}'),0) as 'Avg Days in Stage', round(min(q.'{{cell(Static_1_1.selection, 0, "Text2").asObject()}}'),0) as 'Min Days in Stage', round(max(q.'{{cell(Static_1_1.selection, 0, "Text2").asObject()}}'),0) as 'Max Days in Stage';
result = limit result 2000;

referral_kpis.query:
q = load "${App.Datasets.HLS_Referral8_tp.FullyQualifiedName}";
q_B = filter q by !('Status' in ["Closed - Converted", "Closed - Not Converted", "New", "Rejected"]) && 'IsConverted' == "false";
q_C = filter q by 'Status' in ["Closed - Not Converted", "Rejected"];
q_D = filter q by 'Status' in ["Closed - Not Converted", "Rejected"];
q_E = filter q by 'Status' in ["Closed - Not Converted", "Rejected"];
q_F = filter q by 'Status' in ["Closed - Not Converted", "Rejected"];
q_I = filter q by !('Status' in ["Closed - Converted", "Closed - Not Converted", "New", "Rejected"]) && 'IsConverted' == "false";
q_J = filter q by !('Status' in ["Closed - Converted", "Closed - Not Converted", "New", "Rejected"]) && 'IsConverted' == "false";
q_K = filter q by !('Status' in ["Closed - Converted", "Closed - Not Converted", "New", "Rejected"]) && 'IsConverted' == "false";
q_L = filter q by 'IsConverted' == "true";
q_N = filter q by 'IsConverted' == "true";
q_O = filter q by 'IsConverted' == "true";
q_P = filter q by 'IsConverted' == "true";
result = group q by all full, q_B by all full, q_C by all full, q_D by all full, q_E by all full, q_F by all full, q_I by all full, q_J by all full, q_K by all full, q_L by all full, q_N by all full, q_O by all full, q_P by all;
result = foreach result generate count(q) as 'A', count(q_B) as 'B', count(q_C) as 'C', avg(q_D.'{{cell(Static_1.selection, 0, "Text2").asObject()}}') as 'D', max(q_E.'{{cell(Static_1.selection, 0, "Text2").asObject()}}') as 'E', min(q_F.'{{cell(Static_1.selection, 0, "Text2").asObject()}}') as 'F', avg(q_I.'{{cell(Static_1.selection, 0, "Text2").asObject()}}') as 'I', max(q_J.'{{cell(Static_1.selection, 0, "Text2").asObject()}}') as 'J', min(q_K.'{{cell(Static_1.selection, 0, "Text2").asObject()}}') as 'K', count(q_L) as 'L', avg(q_N.'{{cell(Static_1.selection, 0, "Text2").asObject()}}') as 'N', max(q_O.'{{cell(Static_1.selection, 0, "Text2").asObject()}}') as 'O', min(q_P.'{{cell(Static_1.selection, 0, "Text2").asObject()}}') as 'P';
result = foreach result generate 'A' as 'Total Referrals', 'B' as '# of Open Referrals', round('I',0) as 'Avg Age', 'J' as 'Max Age', 'K' as 'Min Age', coalesce(round((B / A), 3),0) as '% of Open Referrals';
result = order result by ('% of Open Referrals' desc);
result = limit result 2000;
